17,16,32,'2024-12-09','aaaaaaaaaaaaaaaaaaaaaaaaaaaaaa','00:00:25.000000',NULL,'0',NULL,NULL),(118,13,32,'2024-12-09','Learning foign languages is vey important in today\'s world.many people think that knowing more than one language can help them in their life and work. I agree with this idea because iT has many benefits. \\n\\nFirstly, learning another language helps people to communicate with others from difrent countries. For example, if someone knows English and Spanish, they can talk to people from many places. This can make trling easier and more enjoyable. Also, being able to speak another language can help people make new friends and understand difrent cultures better.\\n\\nSecondly, knowing foreign languages can improve job opportunities. Many companies look for employees who can speak more than one language. For instance, in businesses that work with international clients, employees who speak multiple languages are very valuable. This can lead to better jobs and higher salaries.\\n\\nHowever, some people believe that learning a foreign language is too difficult and takes too much time. They think it is better to focus on one language and become very good at it. While it is true that learning a new language can be challenging, the befits are worth the effort. With dedication and practice, anyone can learn a foreign language.\\n\\nIn conclusion, learning foreign languages is iortant because it helps in communication and increases job chances. Even though it might be hard, the advantages make it a worthwhile activity. Therefore, everyone should try to learn at least one foreign language.','00:00:01.000000','21:11:25.329664','1',NULL,NULL),(119,6,41,'2024-12-09','Learning foign languages is vey important in today\'s world.many people think that knowing more than one language can help them in their life and work. I agree with this idea because iT has many benefits. \\n\\nFirstly, learning another language helps people to communicate with others from difrent countries. For example, if someone knows English and Spanish, they can talk to people from many places. This can make trling easier and more enjoyable. Also, being able to speak another language can help people make new friends and understand difrent cultures better.\\n\\nSecondly, knowing foreign languages can improve job opportunities. Many companies look for employees who can speak more than one language. For instance, in businesses that work with international clients, employees who speak multiple languages are very valuable. This can lead to better jobs and higher salaries.\\n\\nHowever, some people believe that learning a foreign language is too difficult and takes too much time. They think it is better to focus on one language and become very good at it. While it is true that learning a new language can be challenging, the befits are worth the effort. With dedication and practice, anyone can learn a foreign language.\\n\\nIn conclusion, learning foreign languages is iortant because it helps in communication and increases job chances. Even though it might be hard, the advantages make it a worthwhile activity. Therefore, everyone should try to learn at least one foreign language.','00:00:02.000000','21:11:58.708522','1',NULL,NULL),(120,8,80,'2024-12-09','huha iufhau ahiufhiua ahf ia fhiua hfiu ahfu iaeh fihv uihv iuash fiua fhiuah fiu','00:02:41.000000','22:29:50.503939','1',NULL,NULL),(121,13,69,'2024-12-09','The pie charts compare home ownership and renting for 1991 and 2007 in percentage terms. In 1991, homeowners were the most popular type of housing, accounting for 60%, or more than over half of all homes. The next largest sector was social rented homes, amounting to 23% or nearly one-third of homes. The remaining homes were mostly privately rented (11%) with a tiny fraction being social housing (6%). Sixteen years later, in 2007, the number of home owners had risen to 70%, or almost three quarters of all homes. This was an increase of 10% compared with 1991. Much of the increase in home ownership can be explained by the decrease in social rented homes, which had dropped from 23% to 17%','00:00:01.000000','16:44:50.005025','1',NULL,NULL),(122,12,35,'2024-12-10','√°dasds','00:00:01.000000',NULL,'0',NULL,NULL),(123,22,32,'2024-12-10','Extracurricular activities play a vital role in a student\'s overall development by fostering personal, social, and academic growth beyond the classroom. These activities provide opportunities for students to explore their interests, develop new skills, and form meaningful connections with peers and mentors.\n\nFirstly, extracurricular activities help students build important life skills such as teamwork, leadership, communication, and time management. Whether it\'s participating in a sports team, drama club, or student government, students often collaborate with others, learning how to work toward a common goal. They also develop leadership abilities by taking on roles that require responsibility and decision-making. These experiences teach students how to handle challenges, make choices, and adapt to different situations, all of which are invaluable in their personal and professional lives.\n\nIn addition to enhancing soft skills, extracurricular activities can foster emotional and mental well-being. Engaging in hobbies or interests outside of academics provides students with an outlet for stress and a sense of accomplishment. This can boost self-esteem and help students feel more confident and resilient. Activities such as music, art, or athletics also allow for creative expression, which is essential for emotional growth.\n\nExtracurriculars also enhance academic performance. By engaging in activities that require focus and discipline, students can improve their concentration and organizational skills, which translate into better study habits. Furthermore, students involved in extracurriculars are often more motivated to excel in their studies, as they learn to balance their time effectively between academic and personal interests.\n\nOverall, extracurricular activities are a crucial aspect of student development, enriching their educational experience, expanding their social networks, and preparing them for success in future careers and life challenges.\n\n\n\n\n','00:00:25.000000',NULL,'0',NULL,NULL),(124,125,69,'2024-12-10','123123','00:00:01.000000','18:34:30.195725','1',NULL,NULL),(125,126,69,'2024-12-10','ok','00:00:03.000000','18:36:29.553780','1',NULL,NULL);
